function Orders(){


    return (
        <>
          <div className="length">
            <div>
              <table className="table table-bordered">
                <thead>
                  <tr className="colr">
                    <td>orderId</td>
                    <td>orderWeight</td>
                    <td>fromAddress</td>
                    <td>toAddress</td>
                    <td>orderStatus</td>
                    <td>orderdDate</td>
                    <td>ecpectedDeliveryDate</td>
                    <td>amount</td>
                  </tr>
                </thead>

                <tbody>
                  {emps.map((emp) => {
                    return (
                      <tr key={emp.empId}>
                        <td>{emp.empId}</td>
                        <td>{emp.firstName}</td>
                        <td>{emp.lastName}</td>
                        <td>{emp.email}</td>
                        <td>{emp.password}</td>
                        <td>{emp.role}</td>
                        <td>{emp.mobile}</td>
                        <td>{emp.gender}</td>

                        <td>
                          <button
                            onClick={() => {
                              navigate(`/editemp/${emp.empId}`);
                            }}
                            className="btn btn-primary"
                          >
                            Edit
                          </button>
                        </td>
                        <td>
                          <button
                            class="btn btn-danger"
                            onClick={() => {
                              deleteEmp(emp.empId);
                            }}
                          >
                            Delete
                          </button>
                        </td>
                      </tr>
                    );
                  })}
                  ;
                </tbody>
              </table>
              <center>
                <button onClick={AddEmp} className="btn btn-primary">
                  Add Emp
                </button>
              </center>
            </div>
          </div>
        </>
      );


}

export default Orders;
